script: |
  super -f text -I q4095.spq | sort > q4095.out

inputs:
  - name: q4095.spq
    data: |
      SELECT DISTINCT + col2, + col1 FROM tab1 (FORMAT parquet) AS cor0 WHERE NOT - col2 BETWEEN + 48 AND - col2 * - col1 * + 26 * - - col1;
  - name: tab1

outputs:
  - name: q4095.out
    data: |
      59	5
      68	47
      96	14
